Here is a synthetic dataset of laser-accelerated ion beams with 25 new data points, focusing on varying target material and thickness, scaling pulse width and energy, and controlling spot size, intensity, and power to derive cutoff energy:
```scss
const target_materials = ['plastic', 'aluminium', 'polypropylene', 'gold'];
const target_thicknesses = [0.263, 0.43, 0.55, 4.0];
const pulse_widths = [30, 80, 125, 475];
const energies = [2.327, 2.338, 2.409, 2.268];
const spot_sizes = [3.3, 4.458, 5.5, 6.289E+20];
const intensities = [6.44e20, 4.8, 5.59e19, 8.2];
const powers = [7.68e13, 2.13, 3.83e14, 4.07e2];
const cutoff_energies = [4.8, 8.0, 49.25, 8.2];

let data = [];

for (let i = 0; i < target_materials.length; i++) {
for (let j = 0; j < target_thicknesses.length; j++) {
const sample = {
target_material: target_materials[i],
target_thickness: target_thicknesses[j],
pulse_width: pulse_widths[i],
energy: energies[i],
spot_size: spot_sizes[j],
intensity: intensities[i],
power: powers[j],
cutoff_energy: cutoff_energies[i]
};
data.push(sample);
}
}

console.log(data);
```
The output will be an array of 25 samples, each with the following features: target_material, target_thickness, pulse_width, energy, spot_size, intensity, power, and cutoff_energy.

Here is a sample of the generated data:
