  {
    "target_material": "plastic",
    "target_thickness": 0.263,
    "pulse_width": 30,
    "energy": 2.327,
    "spot_size": 3.3,
    "intensity": 6.44e20,
    "power": 7.68e13,
    "cutoff_energy": 4.8
  },
  {
    "target_material": "aluminium",
    "target_thickness": 0.43,
    "pulse_width": 30,
    "energy": 2.338,
    "spot_size": 4.458,
    "intensity": 4.8,
    "power": 2.13,
    "cutoff_energy": 8.0
  },
  {
    "target_material": "polypropylene",
    "target_thickness": 0.55,
    "pulse_width": 80,
    "energy": 2.409,
    "spot_size": 5.5,
    "intensity": 5.59e19,
    "power": 3.83e14,
    "cutoff_energy": 49.25
  },
  {
    "target_material": "gold",
    "target_thickness": 4.0,
    "pulse_width": 475,
    "energy": 2.268,
    "spot_size": 6.289E+20,
    "intensity": 8.2,
    "power": 4.07e2,
    "cutoff_energy": 8.2
  }
]
```

